import React from "react"
import "../App.css"


function Navbar() {
  return (
      <div className="navbar">
      <img className="navImage" src="http://www.pngall.com/wp-content/uploads/2016/05/Trollface.png" alt="Header Image not loading" />
      <span className="navText">Meme Generator</span>
      </div>
    )
}

export default Navbar
